IF EXISTS (SELECT 1 FROM sys.databases WHERE name = 'base_consorcio')
BEGIN
    USE master;
    ALTER DATABASE base_consorcio SET SINGLE_USER WITH ROLLBACK IMMEDIATE;
    DROP DATABASE base_consorcio;
END
