-------------------------------------- EJERCICIO 2: ---------------------------------------

------ Tabla Administrador: ------
-- Modificar el tipo de datos de la columna "fechnac" a alfanumérico de 50 caracteres
ALTER TABLE administrador
ALTER COLUMN fechnac varchar(50);

go

-- Agregar restricción para valores menores a '01 de enero del 1998' en la columna "fechnac"
ALTER TABLE administrador
ADD CONSTRAINT CK_fechnac_administrador CHECK (CONVERT(datetime, fechnac, 112) < CONVERT(datetime, '19980101', 112));

go

-- Eliminar la restricción previa "CK_habitante_viveahi"
ALTER TABLE administrador
DROP CONSTRAINT CK_habitante_viveahi;

go

-- Agregar restricción a la columna "viveahi" para aceptar solo "S" o "N"
ALTER TABLE administrador
ADD CONSTRAINT CK_viveahi CHECK (viveahi IN ('S', 'N'));

go

-- Eliminar la restricción previa "CK_sexo"
ALTER TABLE administrador
DROP CONSTRAINT CK_sexo;

go

-- Agregar restricción a la columna "sexo" para aceptar solo "M" o "F"
ALTER TABLE administrador
ADD CONSTRAINT CK_sexo CHECK (sexo IN ('M', 'F'));
----- Fin Tabla Administrador -----

go

------ Tabla Conserje: ------
-- Restricción a la columna "fechnac" para permitir el ingreso solamente de valores menores al '01 de enero del 1998':
ALTER TABLE conserje
ADD CONSTRAINT CK_fechnac_conserje CHECK (fechnac < '01-01-1998');

go

-- Eliminar la restricción previa "CK_estadocivil"
ALTER TABLE conserje
DROP CONSTRAINT CK_estadocivil;

go

-- Restricción en la columna "estciv" para aceptar solo valores "C", "S", "D", "V", "O":
ALTER TABLE conserje
ADD CONSTRAINT CK_estadocivil CHECK (estciv IN ('C', 'S', 'D', 'V', 'O'));
------ Fin Tabla Conserje: ------

go

------ Tabla Provincia: ------
-- Eliminar la columna previa "poblacion"
ALTER TABLE provincia
DROP COLUMN poblacion;

go

-- Modificación: Agregar columna "poblacion" de tipo Entero que permite nulos:
ALTER TABLE provincia
ADD poblacion int NULL;
------ Fin Tabla Provincia: ------

go

------ Tabla Gasto: ------
-- Restricción en la columna "fechapago" para que sea superior o igual a la fecha del día:
ALTER TABLE gasto
ADD CONSTRAINT CK_fechapago CHECK (CONVERT(INT, CONVERT(VARCHAR(8), fechapago, 112)) >= CONVERT(INT, CONVERT(VARCHAR(8), GETDATE(), 112)));

go

-- Restricción en la columna "periodo" para que sea menor o igual al mes actual:
ALTER TABLE gasto
ADD CONSTRAINT CK_periodo CHECK (periodo <= MONTH(GETDATE()));
------ Fin Tabla Gasto: ------

go

